import React, { useState } from 'react';
import './Header.css';

const Header = ({ userName, userProfilePic, handleSignOut }) => {
  const [isMenuOpen, setIsMenuOpen] = useState(false); // For toggling the sidebar or mobile menu

  const toggleMenu = () => {
    setIsMenuOpen(!isMenuOpen);
  };

  return (
    <header className="header">
      <div className="header-left">
        <div className="logo">
          <h1>App Name</h1> {/* Replace with your app logo or name */}
        </div>
        <div className="hamburger-menu" onClick={toggleMenu}>
          &#9776; {/* Hamburger icon */}
        </div>
      </div>

      <div className={`sidebar ${isMenuOpen ? 'open' : ''}`}>
        {/* This could be your sidebar links or additional features */}
        <nav>
          <ul>
            <li><a href="/home">Home</a></li>
            <li><a href="/dashboard">Dashboard</a></li>
            <li><a href="/settings">Settings</a></li>
            <li><button onClick={handleSignOut}>Sign Out</button></li>
          </ul>
        </nav>
      </div>

      <div className="header-right">
        <div className="user-info">
          <img src={userProfilePic} alt="Profile" className="profile-pic" />
          <span>{userName}</span>
        </div>
      </div>
    </header>
  );
};

export default Header;
